import React, { Component } from 'react';

import List from './List';

export default class KanbanBoard extends Component {
    render() {
        let lists = this.props.lists.map((list, listIndex) => {
            return (
                <List 
                    list={list}
                    listIndex={listIndex}
                    key={listIndex}
                    title={list.title}
                />
            )
        })
        return(
            <div>
                {lists}
            </div>
        )
    }
}
